import React from "react";
import { Image } from "@chakra-ui/image";
import { useColorMode } from "@chakra-ui/color-mode";
import { useMediaQuery } from "@chakra-ui/media-query";
import { Stack, Circle, Flex, Box, Text, Heading } from "@chakra-ui/layout";
import { CircularProgressbar, buildStyles } from "react-circular-progressbar";

const Contact = () => {
    const { colorMode } = useColorMode();
    const isDark = colorMode === "dark";
    const [isNotSmallerScreen] = useMediaQuery("(min-width:600px)");
    return (
        <Stack w = "100%" justifyContent="center" alignItems="center">
            <Flex w = "95%" justifyContent="center"  direction={isNotSmallerScreen ? "row" : "column"}
                p={isNotSmallerScreen ? "25" : "0"}
                alignSelf="flex-start"
                alignItems="center"
                flexWrap={isNotSmallerScreen ? "wrap" : null}
                mb = {12} 
                >
                    <Flex w = "60%" height="500px" bg = "blue.100" position="relative" borderRadius = "10px" overflow = "hidden">
                      <Flex position = "absolute" top = "0" left = "0" w = "100%" h = "30px" bg = {isDark?"black" : "red"} >
                          <Flex width = "100px">
                                <div style = {{width: "15px", height: ""}}></div>
                                <div style = {{width: "15px", height: ""}}></div>
                                <div style = {{width: "15px", height: ""}}></div>
                          </Flex>
                          <Flex></Flex>
                      </Flex> 
                    </Flex>

            </Flex>

        </Stack>
    )
}

export default Contact
